(()=>{const u=new URL('https://api.busuanzi.cc/api.php');fetch(u.protocol+'//'+u.host+'/api.php',{method:'POST',body:JSON.stringify({url:location.href,referrer:document.referrer})}).then(r=>r.json()).then(r=>{for(const k in r)document.querySelectorAll('#'+k).forEach(e=>e.innerText=r[k])}).catch(e=>console.error(e))})();